import React from 'react';

import './styles.css';

import usImg from '../../assets/us.jpg'

export default function Home() {
    return (
        <div className="home-container">
            <header>
                <h1>Our Wedding</h1>
            </header>

            <img src={usImg} alt="Us" />
        </div>
    );
}
